import React from 'react';
import {FooterBottom, FooterContainer, FooterTop, SocialButtons} from "./style";
import {Container} from "../../assets/styles";
import {FaceBook, Instagram, YouTube} from "../../assets/icons";
import {IconButton} from "../IconButton/IconButton";


const Footer = () => {
    return (
        <FooterContainer>
            <Container>
                <FooterTop></FooterTop>
                <FooterBottom>
                    <SocialButtons>
                        <IconButton>
                            <Instagram/>
                        </IconButton>
                        <IconButton>
                            <YouTube/>
                        </IconButton>
                        <IconButton>
                            <FaceBook/>
                        </IconButton>
                    </SocialButtons>
                </FooterBottom>
            </Container>
        </FooterContainer>
    );
};

export default Footer;
